import React, { useState, useEffect } from "react";
import UseTable from "./hooks/useTable";
import { useNavigate } from 'react-router-dom'
import axios from 'axios'
import { useAuth } from './auth'
function MyRecipes() {
    const navigate = useNavigate()
    const auth = useAuth()
    const handleLogout = () => {
        auth.logout()
        navigate('/')
    }
    const [table, setTable] = useState()
    useEffect(() => {
        console.log('inside useEffect Popular recipes')

        axios
            .get('http://localhost:3001/recipesPopular')
            .then(res => {
                // console.log(res)
                setTable(res.data[0])
            })
            .catch(err => {
                console.log(err)
            })
    }, [])
    return (
        <>

            <UseTable data={table} />
            <button onClick={() => navigate('/AddNewRecipe')}>Add new recipe on your book</button>

        </>
    )
}
export default MyRecipes
